import React from "react";
import { animateScroll as scroll } from "react-scroll";
import {
  FaDribbble,
  FaBehance,
  FaGithub,
  FaTwitter,
  FaYoutube,
} from "react-icons/fa";

import {
  FooterContainer,
  FooterWrap,
  FooterLinksContainer,
  FooterLinksWrapper,
  FooterLinkItems,
  FooterLinkTitle,
  FooterLink,
  SocialMedia,
  SocialMediaWrap,
  SocialLogo,
  WebsiteRights,
  SocialIcons,
  SocialIconLink,
} from "./FooterElements";

const Footer = () => {
  const toggleHome = () => {
    scroll.scrollToTop();
  };

  return (
    <FooterContainer>
      <FooterWrap>
        <FooterLinksContainer>
              <FooterLinkTitle>Thank you.</FooterLinkTitle>
        </FooterLinksContainer>
        <SocialMedia>
          <SocialMediaWrap>
            <SocialLogo to="/" onClick={toggleHome}>
              Yuya
            </SocialLogo>
            {/* <WebsiteRights>dolla Â© {new Data().getFullYear()}All Right reserved.</WebsiteRights> */}
            <SocialIcons>
              <SocialIcons>
                <SocialIconLink href="https://dribbble.com/Hashirizaki" target="_blank" aria-label="dribbble">
                  <FaDribbble />
                </SocialIconLink>
                <SocialIconLink href="https://www.behance.net/yuyahashirizaki" target="_blank" aria-label="Instagram">
                  <FaBehance />
                </SocialIconLink>
                <SocialIconLink href="https://github.com/Yuya61" target="_blank" aria-label="github">
                  <FaGithub />
                </SocialIconLink>
                <SocialIconLink href="https://www.linkedin.com/in/yuya-hashirizaki-9b0065191" target="_blank" aria-label="Twitter">
                  <FaLin />
                </SocialIconLink>
              </SocialIcons>
            </SocialIcons>
          </SocialMediaWrap>
        </SocialMedia>
      </FooterWrap>
    </FooterContainer>
  );
};

export default Footer;
